import React from "react";
import { BrowserRouter, Link } from "react-router-dom";

const Loginbox = () => {
  return (
    <div>
      <h2>Welcome Back</h2>
      <BrowserRouter>
        <Link to="src/App.js">
          <button>Sign in</button>
        </Link>
      </BrowserRouter>
    </div>
  );
};

export default Loginbox;
